import React , {useState} from 'react'

import './navbar.scss';
// import {auth} from '../../firbase'

const Navbar = (props) => {

  return (
    <div className="navbar-conrtainer">
        <div className="logo">
            <h1>LOGO</h1>
        </div>
        <ul className="pages-list">  
                <li> <a>HOME</a> </li>
                <li> <a>ABOUT</a> </li>
                <li> <a>SERVICE</a> </li>
        </ul>
        <div className="language-select">3</div>
    </div>
  );
};


export default Navbar;
